import Select from "./components/groupedSelect.jsx";
import "./App.css";

function App() {
  return (
    <div>
      <h1 className="App-header">NEANEX QUERY BUILDER</h1>
      <div className="InputBox">
        <div className="Input">
          <Select />
        </div>
      </div>
    </div>
  );
}

export default App;
